import React from "react";
import { Navbar, Nav, Container } from "react-bootstrap";
import { LinkContainer } from "react-router-bootstrap";

const Header = () => {
  return (
    <Navbar bg="primary" variant="dark" expand="lg" className="bounce">
      <Container>
        <LinkContainer to="/">
          <Navbar.Brand>ðŸš€ Kids Code Academy</Navbar.Brand>
        </LinkContainer>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <LinkContainer to="/">
              <Nav.Link>Home</Nav.Link>
            </LinkContainer>
            <LinkContainer to="/upload">
              <Nav.Link>Upload Videos</Nav.Link>
            </LinkContainer>
            <LinkContainer to="/payment">
              <Nav.Link>Book Sessions</Nav.Link>
            </LinkContainer>
            <LinkContainer to="/tutoring">
              <Nav.Link>Online Tutoring</Nav.Link>
            </LinkContainer>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Header;
